-- ----------------------------
-- Procedure structure for `prcursorloop`
-- ----------------------------
DROP PROCEDURE IF EXISTS `prcursorloop`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prcursorloop`()
BEGIN
  DECLARE done INT DEFAULT FALSE;
   
  DECLARE id_pr INTEGER DEFAULT 0;
  DECLARE nom_pr,ape_1_pr, ape_2_pr VARCHAR(50) DEFAULT '';
  DECLARE fecha DATE;

  DECLARE cur_pr_tabla CURSOR FOR
  SELECT COALESCE(t.id,0),COALESCE(t.nombre,''),COALESCE(t.apellido_1,''),COALESCE(t.apellido_2,''), t.fec_nac 
  FROM pr_tabla t;

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

  OPEN cur_pr_tabla;
  looppro : LOOP
  
		FETCH cur_pr_tabla INTO id_pr,nom_pr,ape_1_pr,ape_2_pr,fecha;
    
    -- CAST(YEAR(fecha) as CHAR(4));

    UPDATE pr_tabla SET
    c_especial = CONCAT(nom_pr,' -- ( ',ape_1_pr,' -- ', ape_2_pr,') -',YEAR(fecha))
    WHERE id = id_pr;

    IF done THEN
			LEAVE looppro;
    END IF;

  END LOOP looppro;
  CLOSE cur_pr_tabla;

  SELECT 'Procedimiento ejecutado satisfactoriamente';
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `prcusortemporal`
-- ----------------------------
DROP PROCEDURE IF EXISTS `prcusortemporal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prcusortemporal`()
BEGIN
  DECLARE done INT DEFAULT FALSE;
   
  DECLARE contador INTEGER DEFAULT 1;
  DECLARE nom_pr VARCHAR(50) DEFAULT '';

  DECLARE cur_pr_tabla CURSOR FOR
  SELECT COALESCE(t.nombre,'') 
  FROM pr_tabla t;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

  -- TABLA TEMPORAL
  DROP TEMPORARY TABLE IF EXISTS pr_temporal;
  
  CREATE TEMPORARY TABLE pr_temporal (
    tem_inc INTEGER,
    tem_nombre VARCHAR(50)
  );


  OPEN cur_pr_tabla;
  looppro : LOOP
  
		FETCH cur_pr_tabla INTO nom_pr;
    INSERT pr_temporal VALUES (contador,nom_pr);
    SET contador = contador + 2;

    IF done THEN
			LEAVE looppro;
    END IF;

  END LOOP looppro;
  CLOSE cur_pr_tabla;

  SELECT tem_inc, tem_nombre FROM pr_temporal;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `prinsertarlotes`
-- ----------------------------
DROP PROCEDURE IF EXISTS `prinsertarlotes`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `prinsertarlotes`(IN `ap_dos` varchar(40))
BEGIN
	-- INGRESO DE REGISTROS A UNA TABLA POR LOTES
  DECLARE intervalo INT DEFAULT 4;
  DECLARE cadena VARCHAR(500) DEFAULT '';
  
  WHILE (intervalo <= 2000) DO
 
    SET cadena = '';
    SET cadena = CONCAT(cadena,'INSERT INTO pr_tabla (nombre,apellido_1,apellido_2,estado,fec_nac) values ');
    SET cadena = CONCAT(cadena, '(\'ANDRES\',\'SUAREZ\',\'',ap_dos,'\',1,\'1967-03-24\'),');
    SET cadena = CONCAT(cadena, '(\'JOSE\',\'SUAREZ\',\'',ap_dos,'\',1,\'1980-10-24\'),');
    SET cadena = CONCAT(cadena, '(\'LUIS\',\'LOPEZ\',\'',ap_dos,'\',1,\'2000-12-24\'),');
    SET cadena = CONCAT(cadena, '(\'CARLOS\',\'GRANADOS\',\'',ap_dos,'\',1,\'1994-11-24\'),');
    SET cadena = CONCAT(cadena, '(\'JUAN\',\'DIAZ\',\'',ap_dos,'\',1,\'1967-03-24\');');
    SET intervalo = intervalo + 5;
    
    SET @sentencia = cadena;
    PREPARE stmt FROM @sentencia;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
  
   END WHILE;
  
  SELECT 'Finalizo el ingreso de los 2000 registros';
  -- select cadena;
END
;;
DELIMITER ;

