-- ----------------------------
-- Function structure for `calcular_edad`
-- ----------------------------
DROP FUNCTION IF EXISTS `calcular_edad`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `calcular_edad`(`nfec_nac` date) RETURNS smallint(6)
BEGIN
   DECLARE nedad SMALLINT(4) DEFAULT 0;
   SET nedad = (YEAR(CURDATE()) - YEAR(nfec_nac));
	 RETURN nedad;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `contar_personas`
-- ----------------------------
DROP FUNCTION IF EXISTS `contar_personas`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `contar_personas`() RETURNS int(11)
BEGIN
  #DECLARAR LA VARIABLE contar;
  DECLARE contar INT DEFAULT 0;	
  # realizar consulta para retornar el numero de personas
  SELECT MIN(COALESCE(cedula,0))  INTO contar 
  FROM personas ORDER BY cedula desc LIMIT 1;
  
  # retornar en la variable contar las personas que existen en la tabla.
	RETURN contar;
END
;;
DELIMITER ;
