DROP TRIGGER IF EXISTS `insertar_pr_tabla`;
DELIMITER ;;
CREATE TRIGGER `insertar_pr_tabla` BEFORE INSERT ON `pr_tabla` FOR EACH ROW begin
  DECLARE c_edad SMALLINT(4) DEFAULT 0; 

  IF (new.nombre_completo IS NULL) OR (new.nombre_completo = '') THEN  
    SET new.nombre_completo = concat(COALESCE(new.nombre,'')," -- ",COALESCE(new.apellido_1,'')," -- ",COALESCE(new.apellido_2,''));
  END IF;
  
  IF (new.edad IS NULL) OR (new.edad = 0) THEN  
    SELECT calcular_edad(new.fec_nac) INTO c_edad;
    SET new.edad = c_edad;
  END IF;
  
end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_pr_tabla`;
DELIMITER ;;
CREATE TRIGGER `update_pr_tabla` BEFORE UPDATE ON `pr_tabla` FOR EACH ROW begin
  DECLARE c_edad SMALLINT(4) DEFAULT 0; 

  IF (new.nombre_completo IS NULL) OR (new.nombre_completo = '') THEN  
    SET new.nombre_completo = concat(COALESCE(new.nombre,'')," -- ",COALESCE(new.apellido_1,'')," -- ",COALESCE(new.apellido_2,''));
  END IF;
  
  IF (new.edad IS NULL) OR (new.edad = 0) THEN  
    SELECT calcular_edad(new.fec_nac) INTO c_edad;
    SET new.edad = c_edad;
  END IF;
  
end
;;
DELIMITER ;
